import React, { useState } from 'react';
import SearchBar from './SearchBar';
import Modal from './Modal';
import Carousel from './Carousel';

const Nav = () => {
    const [isModalOpen, setIsModalOpen] = useState(false);
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const openModal = () => setIsModalOpen(true);
    const closeModal = () => setIsModalOpen(false);

    const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

    // Example carousel items
    const categories = [
        { title: 'Art', description: 'Beautiful artworks and sculptures.' },
        { title: 'Electronics', description: 'Latest gadgets and devices.' },
        { title: 'Collectibles', description: 'Rare and valuable items.' },
        { title: 'Furniture', description: 'Stylish and functional furniture.' }
    ];

    return (
        <>
            <nav className="bg-blue-600 text-white py-4">
                <div className="container mx-auto px-4 flex justify-between items-center">
                    <div className="text-2xl font-bold">Lubbenta</div>
                    <div className="flex items-center space-x-6 md:space-x-4">
                        {/* Mobile Menu Toggle Button */}
                        <button
                            className="md:hidden text-white focus:outline-none"
                            onClick={toggleMenu}
                        >
                            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16"></path>
                            </svg>
                        </button>
                        {/* Search Icon */}
                        <button className="md:hidden text-white focus:outline-none">
                            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M11 4a7 7 0 0110 10 7 7 0 01-10 10A7 7 0 0111 4zM11 7l2 2"></path>
                            </svg>
                        </button>
                        <ul className={`md:flex md:space-x-6 items-center ${isMenuOpen ? 'block absolute inset-0 bg-blue-600 md:relative md:bg-transparent' : 'hidden'} md:block`}>
                            <li><a href="#about" className="block py-2 px-4 text-center md:inline hover:text-gray-300">About</a></li>
                            <li><a href="#services" className="block py-2 px-4 text-center md:inline hover:text-gray-300">Services</a></li>
                            <li><a href="#contact" className="block py-2 px-4 text-center md:inline hover:text-gray-300">Contact</a></li>
                            <li className="md:hidden">
                                <SearchBar />
                            </li>
                        </ul>
                        <button onClick={openModal} className="bg-white text-blue-600 py-2 px-4 rounded hover:bg-blue-200 hidden md:block">
                            Sign Up
                        </button>
                    </div>
                </div>
            </nav>
            <Modal isOpen={isModalOpen} onClose={closeModal} />
            <section className="bg-gray-100 py-8">
                <div className="container mx-auto px-4">
                    {/* Banner Section */}
                    <div className="text-center mb-8">
                        <h1 className="text-4xl font-bold mb-4">Welcome to Lubbenta</h1>
                        <p className="text-lg text-gray-700">Explore the exciting world of auctions with our diverse categories. Discover unique items and bid on what interests you the most!</p>
                    </div>
                    {/* Carousel Section */}
                    <h2 className="text-3xl font-bold text-center mb-6">Explore Auction Categories</h2>
                    <Carousel items={categories} />
                </div>
            </section>
        </>
    );
};

export default Nav;
